function getMapData():String {
	if (ExternalInterface.available) {
		try {
			return String(ExternalInterface.call("getMapData"));
		} catch (e:Error) {
			ttrace("getMapData() function unavailable.");
		}
	} else {
		ttrace("Fail, ExternalInterface unavailable!");
	}
	return null;
}

